<!DOCTYPE html>

            </div>

          <div class="image-container">

                  <img
                    class="icon-child"
                    loading="lazy"
                    alt=""
                    src="./public/group-11@2x.png"
                  />

                    alt=""

                    class="clip-path-shape-child"
                    alt=""
                    src="./public/group-31@2x.png"

                <div class="clip-path-shape">

                  loading="lazy"
                  alt=""

            </div>

        </div>
        <div class="image-container-wrapper">

          class="badge-child"
          loading="lazy"
          alt=""
          src="./public/group-36.svg"

          class="highlighted-tab-child"

          alt=""

          loading="lazy"
          alt=""
